import React from 'react';
import ReactDOM from 'react-dom';

class Joke extends React.Component {
    constructor(props){
        super(props);

    }
    render(){
        return (
            <div>
            <h1>Get a joke!</h1>

            <button id="ok" onclick="getJoke();return false;">GET A RANDOM JOKE</button>
            <ul id="list" class="out"></ul>

            </div>
        );
    }
}

ReactDOM.render(
    <Joke />,
    document.getElementById('root')
  );



  function getJoke() {

    fetch("https://official-joke-api.appspot.com/random_joke")
      .then(response => response.json())
      .then(data => {
          const obj=data;
          const setup=obj["setup"];
          const punchline=obj["punchline"];


        renderHtmlList(setup, punchline);

      })
      .catch(() => {
        console.log("Error!");
      });
  }
